قال تعالى: {وَالصُّلْحُ خَيْرٌ}
الساعي في الإصلاح بين الناس أفضل من القانت بالصلاة والصيام والصدقة والمصلح لا بد أن يصلح الله سعيه وعمله كما أن الساعي في الإفساد لا يصلح الله عمله ولا يتم له مقصوده كما قال تعالى: {إِنَّ اللَّهَ لَا يُصْلِحُ عَمَلَ الْمُفْسِدِينَ}
.
- تفسير السعدي
